import React from "react";
import "./SingleRoute.css";

function SingleRoute({ data }) {
  return (
    <div className="singleRoute  container">
      <div className="singleroute__wrapper">
        <div className="card">
          <div className="singleroute__image">
            <img src={el.url} alt="rasm" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default SingleRoute;
